import React from "react";
import styled from "styled-components";

const Button = styled.button`
right: 100px;
height: 50px;
border: none;
outline: none;
background: #005fff;
border-radius: 50px;
font-family: Helvetica Neue, sans-serif;
font-weight: bold;
font-size: 15px;
line-height: 18px;
color: #ffffff;
cursor: pointer;
flex: 1;
`;

